const config = {
  "previewFeatures": [],
  "clientVersion": "7.3.0",
  "engineVersion": "9d6ad21cbbceab97458517b147a6a09ff43aa735",
  "activeProvider": "postgresql",
  "inlineSchema": "// FitAdmin - Personal Trainers & Fitness Studios\n// Prisma schema for fitness vertical\n\ndatasource db {\n  provider = \"postgresql\"\n}\n\ngenerator client {\n  provider = \"prisma-client-js\"\n  output   = \"../src/generated/prisma\"\n}\n\n// ============================================\n// ENUMS\n// ============================================\n\nenum Vertical {\n  MUSICIANS\n  PHOTOGRAPHY\n  FITNESS\n  EVENTS\n  PERFORMING_ARTS\n  TEAM_BUILDING\n  KIDS_ENTERTAINMENT\n}\n\n// Billing enums\nenum BankProvider {\n  FIO\n  WISE\n  REVOLUT\n  PLAID\n  NORDIGEN\n  MANUAL\n}\n\nenum TransactionType {\n  DEBIT\n  CREDIT\n}\n\nenum PaymentMethod {\n  BANK_TRANSFER\n  CARD\n  CASH\n  PAYPAL\n  STRIPE\n  GOPAY\n  CRYPTO\n}\n\nenum ExpenseStatus {\n  DRAFT\n  PENDING\n  APPROVED\n  REJECTED\n  REIMBURSED\n}\n\n// ============================================\n// TENANT & ORGANIZATION\n// ============================================\n\nmodel Tenant {\n  id               String   @id @default(cuid())\n  vertical         Vertical\n  name             String\n  slug             String   @unique\n  email            String?\n  phone            String?\n  website          String?\n  logo             String?\n  subscriptionTier String   @default(\"free\") // free, pro, enterprise\n  aiCredits        Int      @default(100)\n  createdAt        DateTime @default(now())\n  updatedAt        DateTime @updatedAt\n\n  // Relations\n  users    User[]\n  clients  Client[]\n  sessions Session[]\n  classes  Class[]\n  packages Package[]\n  orders   Order[]\n  invoices Invoice[]\n  aiLogs   AILog[]\n\n  // Billing relations\n  bankAccounts              BankAccount[]\n  bankTransactions          BankTransaction[]\n  invoicePayments           InvoicePayment[]\n  paymentGatewayConfigs     PaymentGatewayConfig[]\n  cryptoWallets             CryptoWallet[]\n  expenseCategories         ExpenseCategory[]\n  expenses                  Expense[]\n  recurringInvoiceTemplates RecurringInvoiceTemplate[]\n\n  // Feature relations\n  badges            Badge[]\n  workoutTemplates  WorkoutTemplate[]\n  scheduleTemplates ScheduleTemplate[]\n\n  @@map(\"tenants\")\n}\n\n// ============================================\n// AUTHENTICATION\n// ============================================\n\nmodel User {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  name          String?\n  email         String    @unique\n  emailVerified DateTime?\n  image         String?\n  password      String?\n  role          String    @default(\"user\") // admin, trainer, user\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  accounts Account[]\n  sessions UserSession[]\n\n  @@map(\"users\")\n}\n\nmodel Account {\n  id                String  @id @default(cuid())\n  userId            String\n  type              String\n  provider          String\n  providerAccountId String\n  refresh_token     String? @db.Text\n  access_token      String? @db.Text\n  expires_at        Int?\n  token_type        String?\n  scope             String?\n  id_token          String? @db.Text\n  session_state     String?\n\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@unique([provider, providerAccountId])\n  @@map(\"accounts\")\n}\n\nmodel UserSession {\n  id           String   @id @default(cuid())\n  sessionToken String   @unique\n  userId       String\n  expires      DateTime\n  user         User     @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@map(\"user_sessions\")\n}\n\nmodel VerificationToken {\n  identifier String\n  token      String   @unique\n  expires    DateTime\n\n  @@unique([identifier, token])\n  @@map(\"verification_tokens\")\n}\n\nmodel PasswordResetToken {\n  id        String   @id @default(cuid())\n  email     String\n  token     String   @unique\n  expires   DateTime\n  createdAt DateTime @default(now())\n\n  @@index([email])\n  @@map(\"password_reset_tokens\")\n}\n\n// ============================================\n// CLIENT MANAGEMENT (Fitness-specific)\n// ============================================\n\nmodel Client {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  // Basic info\n  name        String\n  email       String\n  phone       String?\n  avatar      String?\n  dateOfBirth DateTime?\n  gender      String?\n\n  // Fitness-specific\n  goals            String[] // weight_loss, muscle_gain, strength, endurance, flexibility\n  currentWeight    Float? // kg\n  targetWeight     Float? // kg\n  height           Float? // cm\n  bodyMeasurements Json? // { chest: 100, waist: 80, hips: 95, ... }\n  bodyFatPercent   Float?\n  fitnessLevel     String? // beginner, intermediate, advanced\n  injuryHistory    String?  @db.Text\n  dietaryNotes     String?  @db.Text\n  medicalNotes     String?  @db.Text\n\n  // Membership\n  creditsRemaining Int       @default(0)\n  membershipType   String? // monthly, yearly, package\n  membershipExpiry DateTime?\n\n  // Status\n  status String   @default(\"active\") // active, inactive, paused\n  tags   String[]\n  notes  String?  @db.Text\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Referral\n  referralCode String? @unique\n\n  // Relations\n  sessions         Session[]\n  orders           Order[]\n  invoices         Invoice[]\n  measurements     ClientMeasurement[]\n  progressPhotos   ProgressPhoto[]\n  badges           ClientBadge[]\n  events           ClientEvent[]\n  subscriptions    Subscription[]\n  emailEnrollments EmailSequenceEnrollment[]\n  referredBy       Referral[]                @relation(\"Referred\")\n  referrals        Referral[]                @relation(\"Referrer\")\n\n  @@map(\"clients\")\n}\n\nmodel ClientMeasurement {\n  id       String @id @default(cuid())\n  clientId String\n  client   Client @relation(fields: [clientId], references: [id], onDelete: Cascade)\n\n  date         DateTime @default(now())\n  weight       Float? // kg\n  bodyFat      Float? // percentage\n  measurements Json? // { chest, waist, hips, biceps, thighs, ... }\n  notes        String?\n\n  createdAt DateTime @default(now())\n\n  @@map(\"client_measurements\")\n}\n\nmodel ProgressPhoto {\n  id       String @id @default(cuid())\n  clientId String\n  client   Client @relation(fields: [clientId], references: [id], onDelete: Cascade)\n\n  url   String\n  date  DateTime @default(now())\n  view  String // front, back, side\n  notes String?\n\n  createdAt DateTime @default(now())\n\n  @@map(\"progress_photos\")\n}\n\n// ============================================\n// TRAINING SESSIONS (1-on-1)\n// ============================================\n\nmodel Session {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  clientId String\n  client   Client @relation(fields: [clientId], references: [id], onDelete: Cascade)\n\n  // Scheduling\n  scheduledAt DateTime\n  duration    Int      @default(60) // minutes\n  status      String   @default(\"scheduled\") // scheduled, completed, cancelled, no_show\n\n  // Workout data\n  workoutPlan     Json? // AI-generated plan\n  exercisesLogged Json[] // Completed exercises\n  caloriesBurned  Int?\n  heartRateAvg    Int?\n  muscleGroups    String[] // chest, back, legs, etc.\n\n  // Feedback\n  clientFeedback String? @db.Text\n  trainerNotes   String? @db.Text\n  intensity      String? // low, moderate, high\n  clientRating   Int? // 1-5\n\n  // Payment\n  price Float?\n  paid  Boolean @default(false)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@map(\"sessions\")\n}\n\n// ============================================\n// GROUP CLASSES\n// ============================================\n\nmodel Class {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  name        String\n  description String? @db.Text\n  type        String // yoga, pilates, hiit, spin, etc.\n\n  // Scheduling\n  scheduledAt DateTime\n  duration    Int // minutes\n  capacity    Int      @default(10)\n\n  // Details\n  instructor String?\n  location   String?\n  price      Float\n\n  // Recurring\n  isRecurring Boolean @default(false)\n  recurrence  String? // weekly, biweekly, monthly\n\n  status String @default(\"scheduled\") // scheduled, completed, cancelled\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  bookings ClassBooking[]\n\n  @@map(\"classes\")\n}\n\nmodel ClassBooking {\n  id       String @id @default(cuid())\n  classId  String\n  class    Class  @relation(fields: [classId], references: [id], onDelete: Cascade)\n  clientId String\n  // Note: Client relation would reference Client model\n\n  status    String  @default(\"confirmed\") // confirmed, waitlist, cancelled\n  checkedIn Boolean @default(false)\n  paid      Boolean @default(false)\n\n  createdAt DateTime @default(now())\n\n  @@map(\"class_bookings\")\n}\n\n// ============================================\n// PACKAGES & CREDITS\n// ============================================\n\nmodel Package {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  name        String\n  description String? @db.Text\n  type        String // sessions, classes, monthly\n\n  // Pricing\n  price        Float\n  credits      Int // Number of sessions/classes\n  validityDays Int // How long package is valid\n\n  // Features\n  features String[]\n  isActive Boolean  @default(true)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  subscriptions Subscription[]\n\n  @@map(\"packages\")\n}\n\n// ============================================\n// ORDERS & INVOICING\n// ============================================\n\nmodel Order {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  clientId String\n  client   Client @relation(fields: [clientId], references: [id], onDelete: Cascade)\n\n  orderNumber String @unique\n  status      String @default(\"pending\") // pending, confirmed, completed, cancelled\n\n  // Items\n  items Json[] // [{ type, name, quantity, price }]\n\n  // Pricing\n  subtotal Float\n  tax      Float @default(0)\n  discount Float @default(0)\n  total    Float\n\n  // Payment\n  paymentMethod String?\n  paymentStatus String  @default(\"unpaid\") // unpaid, partial, paid\n  paidAmount    Float   @default(0)\n\n  // Dates\n  orderDate DateTime  @default(now())\n  dueDate   DateTime?\n  paidDate  DateTime?\n\n  notes String? @db.Text\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  invoices Invoice[]\n\n  @@map(\"orders\")\n}\n\nmodel Invoice {\n  id       String  @id @default(cuid())\n  tenantId String\n  tenant   Tenant  @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  orderId  String?\n  order    Order?  @relation(fields: [orderId], references: [id])\n  clientId String\n  client   Client  @relation(fields: [clientId], references: [id], onDelete: Cascade)\n\n  invoiceNumber String @unique\n  status        String @default(\"draft\") // draft, sent, paid, overdue, cancelled, partial\n\n  // Dates\n  issueDate DateTime  @default(now())\n  dueDate   DateTime\n  paidDate  DateTime?\n\n  // Amounts\n  subtotal Float\n  tax      Float @default(0)\n  total    Float\n\n  // Partial payment tracking\n  amountPaid      Decimal  @default(0) @db.Decimal(10, 2)\n  amountRemaining Decimal? @db.Decimal(10, 2)\n\n  // Subscription link\n  subscriptionId String?\n  subscription   Subscription? @relation(\"SubscriptionInvoices\", fields: [subscriptionId], references: [id])\n\n  // Dunning\n  dunningLevel Int     @default(0)\n  templateId   String?\n\n  // Payment\n  paymentMethod String?\n\n  notes String? @db.Text\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Billing relations\n  payments         InvoicePayment[]\n  bankTransactions BankTransaction[]\n  cryptoPayments   CryptoPayment[]\n  creditNotes      CreditNote[]\n  dunningSteps     DunningStep[]\n\n  @@map(\"invoices\")\n}\n\n// ============================================\n// AI LOGGING\n// ============================================\n\nmodel AILog {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  feature String // workout_generator, progress_predictor, nutrition_advisor, etc.\n  model   String // gpt-4o, gpt-4o-mini\n\n  // Usage\n  promptTokens     Int\n  completionTokens Int\n  totalTokens      Int\n  estimatedCost    Float\n\n  // Request/Response\n  input  Json\n  output Json?\n\n  // Performance\n  latencyMs Int?\n  success   Boolean @default(true)\n  error     String?\n\n  createdAt DateTime @default(now())\n\n  @@map(\"ai_logs\")\n}\n\n// ============================================\n// BILLING MODELS - CURRENCY & EXCHANGE\n// ============================================\n\nmodel Currency {\n  id           String  @id @default(cuid())\n  code         String  @unique // CZK, EUR, USD, BTC, etc.\n  name         String\n  symbol       String\n  decimals     Int     @default(2)\n  isCrypto     Boolean @default(false)\n  isStablecoin Boolean @default(false)\n  isActive     Boolean @default(true)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  exchangeRatesFrom ExchangeRate[] @relation(\"FromCurrency\")\n  exchangeRatesTo   ExchangeRate[] @relation(\"ToCurrency\")\n\n  @@index([code])\n  @@map(\"currencies\")\n}\n\nmodel ExchangeRate {\n  id             String   @id @default(cuid())\n  fromCurrencyId String\n  toCurrencyId   String\n  rate           Decimal  @db.Decimal(20, 10)\n  source         String // ECB, CNB, OpenExchange, Coinbase, Manual\n  timestamp      DateTime\n\n  fromCurrency Currency @relation(\"FromCurrency\", fields: [fromCurrencyId], references: [id])\n  toCurrency   Currency @relation(\"ToCurrency\", fields: [toCurrencyId], references: [id])\n\n  @@unique([fromCurrencyId, toCurrencyId, timestamp])\n  @@index([timestamp])\n  @@map(\"exchange_rates\")\n}\n\n// ============================================\n// BILLING MODELS - BANK ACCOUNTS\n// ============================================\n\nmodel BankAccount {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  // Account details\n  accountName   String\n  accountNumber String\n  bankCode      String?\n  iban          String?\n  swift         String?\n\n  // Provider\n  provider          BankProvider\n  providerAccountId String?\n\n  // Currency & balance\n  currency         String    @default(\"EUR\")\n  balance          Decimal?  @db.Decimal(12, 2)\n  balanceUpdatedAt DateTime?\n\n  // Sync settings\n  autoSync      Boolean   @default(false)\n  lastSyncAt    DateTime?\n  syncFrequency String    @default(\"MANUAL\") // MANUAL, HOURLY, DAILY, WEEKLY\n\n  // Encrypted credentials (JSON)\n  credentials Json? @db.JsonB\n\n  // Status\n  isActive Boolean @default(true)\n\n  // Metadata\n  metadata Json? @db.JsonB\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  transactions BankTransaction[]\n\n  @@index([tenantId])\n  @@index([provider])\n  @@map(\"bank_accounts\")\n}\n\nmodel BankTransaction {\n  id            String      @id @default(cuid())\n  bankAccountId String\n  bankAccount   BankAccount @relation(fields: [bankAccountId], references: [id], onDelete: Cascade)\n  tenantId      String\n  tenant        Tenant      @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  // Transaction details\n  transactionId String // Bank's transaction ID\n  date          DateTime\n  amount        Decimal  @db.Decimal(12, 2)\n  currency      String\n\n  // Type\n  type TransactionType\n\n  // Counterparty\n  counterpartyName     String?\n  counterpartyAccount  String?\n  counterpartyBankCode String?\n\n  // Description\n  description    String? @db.Text\n  note           String? @db.Text\n  variableSymbol String?\n  constantSymbol String?\n  specificSymbol String?\n\n  // Reference\n  reference String?\n\n  // Matching\n  isMatched        Boolean  @default(false)\n  matchedInvoiceId String?\n  matchedInvoice   Invoice? @relation(fields: [matchedInvoiceId], references: [id])\n  matchedPaymentId String?\n  matchConfidence  Decimal? @db.Decimal(3, 2) // 0.00 to 1.00\n\n  // AI suggestions\n  aiSuggestions Json? @db.JsonB\n\n  // Metadata\n  metadata Json? @db.JsonB\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([bankAccountId, transactionId])\n  @@index([tenantId])\n  @@index([date])\n  @@index([isMatched])\n  @@map(\"bank_transactions\")\n}\n\n// ============================================\n// BILLING MODELS - INVOICE PAYMENTS\n// ============================================\n\nmodel InvoicePayment {\n  id        String  @id @default(cuid())\n  tenantId  String\n  tenant    Tenant  @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  invoiceId String\n  invoice   Invoice @relation(fields: [invoiceId], references: [id], onDelete: Cascade)\n\n  // Payment details\n  amount   Decimal       @db.Decimal(10, 2)\n  currency String\n  method   PaymentMethod\n  status   String        @default(\"PENDING\") // PENDING, PROCESSING, COMPLETED, FAILED, CANCELLED, REFUNDED\n\n  // Gateway info\n  gatewayProvider  String?\n  gatewayPaymentId String?\n  gatewayFee       Decimal? @db.Decimal(10, 2)\n\n  // Transaction details\n  transactionId String?\n  reference     String?\n\n  // Dates\n  processedAt DateTime?\n  completedAt DateTime?\n\n  // Metadata\n  metadata Json? @db.JsonB\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([tenantId])\n  @@index([invoiceId])\n  @@index([status])\n  @@map(\"invoice_payments\")\n}\n\n// ============================================\n// BILLING MODELS - PAYMENT GATEWAY\n// ============================================\n\nmodel PaymentGatewayConfig {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  // Provider\n  provider String // STRIPE, PAYPAL, GOPAY, ADYEN, SQUARE\n\n  // Config (encrypted)\n  config Json @db.JsonB\n\n  // Status\n  isActive Boolean @default(true)\n  isTest   Boolean @default(false)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([tenantId, provider])\n  @@index([tenantId])\n  @@map(\"payment_gateway_configs\")\n}\n\n// ============================================\n// BILLING MODELS - CRYPTO PAYMENTS\n// ============================================\n\nmodel CryptoWallet {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  // Wallet details\n  currency String // BTC, ETH, USDC, USDT\n  address  String\n  network  String? // mainnet, testnet, polygon, etc.\n\n  // Provider\n  provider String // COINBASE_COMMERCE, BTCPAY_SERVER, CIRCLE\n\n  // Status\n  isActive Boolean @default(true)\n\n  // Metadata\n  metadata Json? @db.JsonB\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  payments CryptoPayment[]\n\n  @@unique([tenantId, currency, address])\n  @@index([tenantId])\n  @@map(\"crypto_wallets\")\n}\n\nmodel CryptoPayment {\n  id        String       @id @default(cuid())\n  walletId  String\n  wallet    CryptoWallet @relation(fields: [walletId], references: [id], onDelete: Cascade)\n  invoiceId String?\n  invoice   Invoice?     @relation(fields: [invoiceId], references: [id])\n\n  // Payment details\n  amount        String // Crypto amounts as strings for precision\n  currency      String\n  txHash        String? // Transaction hash\n  confirmations Int     @default(0)\n\n  // Status\n  status String @default(\"PENDING\") // PENDING, CONFIRMED, COMPLETED, FAILED\n\n  // Dates\n  detectedAt  DateTime?\n  confirmedAt DateTime?\n\n  // Metadata\n  metadata Json? @db.JsonB\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([walletId])\n  @@index([status])\n  @@map(\"crypto_payments\")\n}\n\n// ============================================\n// BILLING MODELS - EXPENSES\n// ============================================\n\nmodel ExpenseCategory {\n  id          String  @id @default(cuid())\n  tenantId    String\n  tenant      Tenant  @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  name        String\n  description String?\n  isDefault   Boolean @default(false)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  expenses Expense[]\n\n  @@unique([tenantId, name])\n  @@index([tenantId])\n  @@map(\"expense_categories\")\n}\n\nmodel Expense {\n  id         String          @id @default(cuid())\n  tenantId   String\n  tenant     Tenant          @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  categoryId String\n  category   ExpenseCategory @relation(fields: [categoryId], references: [id])\n\n  // Basic info\n  description String\n  amount      Decimal @db.Decimal(10, 2)\n  currency    String\n\n  // Date\n  date DateTime\n\n  // Vendor\n  vendor String?\n\n  // Receipt\n  receiptUrl     String?\n  receiptOcrData Json?   @db.JsonB\n\n  // Tax\n  taxAmount       Decimal? @db.Decimal(10, 2)\n  isTaxDeductible Boolean  @default(false)\n\n  // Status\n  status ExpenseStatus\n\n  // Approval\n  approvedBy     String?\n  approvedAt     DateTime?\n  rejectedReason String?\n\n  // Reimbursement\n  reimbursedAt     DateTime?\n  reimbursedAmount Decimal?  @db.Decimal(10, 2)\n\n  // Notes\n  notes String? @db.Text\n\n  // Metadata\n  metadata Json? @db.JsonB\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([tenantId])\n  @@index([status])\n  @@index([date])\n  @@map(\"expenses\")\n}\n\n// ============================================\n// BILLING MODELS - RECURRING INVOICES\n// ============================================\n\nmodel RecurringInvoiceTemplate {\n  id       String @id @default(cuid())\n  tenantId String\n  tenant   Tenant @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n\n  // Recurrence\n  frequency       String // WEEKLY, BIWEEKLY, MONTHLY, QUARTERLY, YEARLY\n  nextInvoiceDate DateTime\n  isActive        Boolean  @default(true)\n\n  // Invoice template (JSON)\n  invoiceTemplate Json @db.JsonB\n\n  // Metadata\n  metadata Json? @db.JsonB\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([tenantId])\n  @@index([nextInvoiceDate])\n  @@map(\"recurring_invoice_templates\")\n}\n\n// ============================================\n// PUSH NOTIFICATIONS\n// ============================================\n\nmodel PushSubscription {\n  id         String   @id @default(cuid())\n  tenantId   String\n  userId     String?\n  clientId   String?\n  endpoint   String\n  p256dh     String\n  auth       String\n  userAgent  String?\n  deviceName String?\n  isActive   Boolean  @default(true)\n  createdAt  DateTime @default(now())\n  updatedAt  DateTime @updatedAt\n\n  @@unique([endpoint])\n  @@index([tenantId])\n  @@index([userId])\n  @@index([clientId])\n  @@map(\"push_subscriptions\")\n}\n\nmodel NotificationPreference {\n  id                    String   @id @default(cuid())\n  tenantId              String\n  userId                String?\n  clientId              String?\n  sessionReminders      Boolean  @default(true)\n  classReminders        Boolean  @default(true)\n  invoiceNotifications  Boolean  @default(true)\n  paymentNotifications  Boolean  @default(true)\n  atRiskAlerts          Boolean  @default(true)\n  reminderMinutesBefore Int      @default(60)\n  emailEnabled          Boolean  @default(true)\n  pushEnabled           Boolean  @default(true)\n  createdAt             DateTime @default(now())\n  updatedAt             DateTime @updatedAt\n\n  @@unique([tenantId, userId])\n  @@index([tenantId])\n  @@map(\"notification_preferences\")\n}\n\nmodel NotificationLog {\n  id            String    @id @default(cuid())\n  tenantId      String\n  type          String // session_reminder, class_reminder, invoice, payment, at_risk\n  recipientType String // user, client\n  recipientId   String\n  title         String\n  body          String\n  data          Json?     @db.JsonB\n  channel       String // push, email, both\n  status        String // pending, sent, failed, delivered\n  error         String?\n  sentAt        DateTime?\n  createdAt     DateTime  @default(now())\n\n  @@index([tenantId])\n  @@index([recipientType, recipientId])\n  @@index([status])\n  @@map(\"notification_logs\")\n}\n\n// ============================================\n// CALENDAR INTEGRATION\n// ============================================\n\nmodel CalendarIntegration {\n  id            String    @id @default(cuid())\n  tenantId      String\n  userId        String\n  provider      String // google, apple\n  accessToken   String?   @db.Text\n  refreshToken  String?   @db.Text\n  tokenExpiry   DateTime?\n  calendarId    String?\n  calendarEmail String?\n  syncEnabled   Boolean   @default(true)\n  syncDirection String    @default(\"both\") // both, to_calendar, from_calendar\n  lastSyncAt    DateTime?\n  createdAt     DateTime  @default(now())\n  updatedAt     DateTime  @updatedAt\n\n  eventSyncs CalendarEventSync[]\n\n  @@unique([tenantId, userId, provider])\n  @@index([tenantId])\n  @@index([userId])\n  @@map(\"calendar_integrations\")\n}\n\nmodel CalendarEventSync {\n  id              String              @id @default(cuid())\n  integrationId   String\n  integration     CalendarIntegration @relation(fields: [integrationId], references: [id], onDelete: Cascade)\n  entityType      String // session, class\n  entityId        String\n  externalEventId String\n  lastSyncedAt    DateTime\n  syncHash        String // Hash of event data to detect changes\n\n  @@unique([integrationId, entityType, entityId])\n  @@index([entityType, entityId])\n  @@map(\"calendar_event_syncs\")\n}\n\nmodel CalendarFeedToken {\n  id        String    @id @default(cuid())\n  tenantId  String\n  userId    String\n  token     String    @unique\n  createdAt DateTime  @default(now())\n  expiresAt DateTime?\n\n  @@index([tenantId])\n  @@index([userId])\n  @@map(\"calendar_feed_tokens\")\n}\n\n// ============================================\n// ACHIEVEMENT BADGES & GAMIFICATION\n// ============================================\n\nmodel Badge {\n  id          String   @id @default(cuid())\n  tenantId    String\n  tenant      Tenant   @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  name        String\n  description String\n  icon        String\n  color       String\n  category    String // consistency, progress, milestone, social\n  criteria    Json // { type: \"sessions_completed\", value: 10 }\n  isActive    Boolean  @default(true)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  clientBadges ClientBadge[]\n\n  @@map(\"badges\")\n}\n\nmodel ClientBadge {\n  id       String   @id @default(cuid())\n  clientId String\n  client   Client   @relation(fields: [clientId], references: [id], onDelete: Cascade)\n  badgeId  String\n  badge    Badge    @relation(fields: [badgeId], references: [id], onDelete: Cascade)\n  earnedAt DateTime @default(now())\n  notified Boolean  @default(false)\n\n  @@unique([clientId, badgeId])\n  @@map(\"client_badges\")\n}\n\n// ============================================\n// WORKOUT TEMPLATE LIBRARY\n// ============================================\n\nmodel WorkoutTemplate {\n  id           String   @id @default(cuid())\n  tenantId     String\n  tenant       Tenant   @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  name         String\n  description  String?\n  category     String // strength, cardio, hiit, flexibility\n  difficulty   String // beginner, intermediate, advanced\n  duration     Int // minutes\n  exercises    Json[]\n  muscleGroups String[]\n  equipment    String[]\n  isPublic     Boolean  @default(false)\n  usageCount   Int      @default(0)\n  createdAt    DateTime @default(now())\n  updatedAt    DateTime @updatedAt\n\n  @@map(\"workout_templates\")\n}\n\n// ============================================\n// SCHEDULE TEMPLATES\n// ============================================\n\nmodel ScheduleTemplate {\n  id          String   @id @default(cuid())\n  tenantId    String\n  tenant      Tenant   @relation(fields: [tenantId], references: [id], onDelete: Cascade)\n  name        String\n  description String?\n  slots       Json[] // [{ dayOfWeek: 1, startTime: \"09:00\", duration: 60, type: \"session\" }]\n  isActive    Boolean  @default(true)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  @@map(\"schedule_templates\")\n}\n\n// ============================================\n// CLIENT JOURNEY TIMELINE\n// ============================================\n\nmodel ClientEvent {\n  id          String   @id @default(cuid())\n  clientId    String\n  client      Client   @relation(fields: [clientId], references: [id], onDelete: Cascade)\n  tenantId    String\n  eventType   String // session_completed, measurement_recorded, badge_earned, invoice_paid, milestone, note, package_purchased\n  eventDate   DateTime @default(now())\n  title       String\n  description String?  @db.Text\n  metadata    Json?    @db.JsonB\n  isMilestone Boolean  @default(false)\n  createdAt   DateTime @default(now())\n\n  @@index([clientId, eventDate])\n  @@index([tenantId, eventDate])\n  @@map(\"client_events\")\n}\n\n// ============================================\n// SUBSCRIPTIONS (RECURRING BILLING)\n// ============================================\n\nmodel Subscription {\n  id        String   @id @default(cuid())\n  tenantId  String\n  clientId  String\n  client    Client   @relation(fields: [clientId], references: [id], onDelete: Cascade)\n  packageId String?\n  package   Package? @relation(fields: [packageId], references: [id])\n\n  // Pricing\n  amount   Decimal @db.Decimal(10, 2)\n  currency String  @default(\"CZK\")\n\n  // Billing schedule\n  frequency       String // WEEKLY, BIWEEKLY, MONTHLY, QUARTERLY, YEARLY\n  nextBillingDate DateTime\n  billingDay      Int? // Day of month (1-31) or day of week (1-7)\n\n  // Status\n  status      String    @default(\"active\") // active, paused, cancelled, expired, past_due\n  startDate   DateTime  @default(now())\n  endDate     DateTime?\n  pausedAt    DateTime?\n  cancelledAt DateTime?\n\n  // Stripe integration\n  stripeCustomerId      String?\n  stripeSubscriptionId  String?\n  stripePaymentMethodId String?\n\n  // Auto-renewal settings\n  autoRenew  Boolean @default(true)\n  retryCount Int     @default(0)\n  maxRetries Int     @default(3)\n\n  // Payment tracking\n  lastPaymentDate   DateTime?\n  lastPaymentStatus String?\n  reminderSent      Boolean   @default(false)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  generatedInvoices Invoice[] @relation(\"SubscriptionInvoices\")\n\n  @@index([tenantId, status, nextBillingDate])\n  @@index([clientId])\n  @@map(\"subscriptions\")\n}\n\n// ============================================\n// ADVANCED INVOICING\n// ============================================\n\nmodel CreditNote {\n  id               String    @id @default(cuid())\n  tenantId         String\n  invoiceId        String\n  invoice          Invoice   @relation(fields: [invoiceId], references: [id])\n  creditNoteNumber String    @unique\n  issueDate        DateTime  @default(now())\n  subtotal         Decimal   @db.Decimal(10, 2)\n  tax              Decimal   @default(0) @db.Decimal(10, 2)\n  total            Decimal   @db.Decimal(10, 2)\n  reason           String\n  notes            String?   @db.Text\n  status           String    @default(\"draft\") // draft, issued, applied\n  appliedAt        DateTime?\n  createdAt        DateTime  @default(now())\n  updatedAt        DateTime  @updatedAt\n\n  @@index([tenantId, invoiceId])\n  @@map(\"credit_notes\")\n}\n\nmodel InvoiceTemplate {\n  id           String   @id @default(cuid())\n  tenantId     String\n  name         String\n  description  String?\n  logo         String?\n  primaryColor String?\n  headerText   String?  @db.Text\n  footerText   String?  @db.Text\n  showLogo     Boolean  @default(true)\n  showVat      Boolean  @default(true)\n  showQrCode   Boolean  @default(true)\n  isDefault    Boolean  @default(false)\n  createdAt    DateTime @default(now())\n  updatedAt    DateTime @updatedAt\n\n  @@index([tenantId])\n  @@map(\"invoice_templates\")\n}\n\nmodel DunningStep {\n  id          String    @id @default(cuid())\n  tenantId    String\n  invoiceId   String\n  invoice     Invoice   @relation(fields: [invoiceId], references: [id])\n  step        Int\n  action      String // reminder_sent, final_notice, collections\n  sentAt      DateTime  @default(now())\n  dueDate     DateTime\n  response    String?\n  respondedAt DateTime?\n\n  @@index([tenantId, invoiceId])\n  @@map(\"dunning_steps\")\n}\n\n// ============================================\n// EMAIL SEQUENCES\n// ============================================\n\nmodel EmailSequence {\n  id            String   @id @default(cuid())\n  tenantId      String\n  name          String\n  description   String?\n  triggerType   String // client_created, package_purchased, session_completed, days_inactive, membership_expiring, manual\n  triggerConfig Json?    @db.JsonB\n  isActive      Boolean  @default(true)\n  createdAt     DateTime @default(now())\n  updatedAt     DateTime @updatedAt\n\n  steps       EmailSequenceStep[]\n  enrollments EmailSequenceEnrollment[]\n\n  @@index([tenantId, triggerType])\n  @@map(\"email_sequences\")\n}\n\nmodel EmailSequenceStep {\n  id          String        @id @default(cuid())\n  sequenceId  String\n  sequence    EmailSequence @relation(fields: [sequenceId], references: [id], onDelete: Cascade)\n  stepOrder   Int\n  delayDays   Int           @default(0)\n  delayHours  Int           @default(0)\n  subject     String\n  htmlContent String        @db.Text\n  textContent String?       @db.Text\n  conditions  Json?         @db.JsonB\n  createdAt   DateTime      @default(now())\n  updatedAt   DateTime      @updatedAt\n\n  @@index([sequenceId])\n  @@map(\"email_sequence_steps\")\n}\n\nmodel EmailSequenceEnrollment {\n  id          String        @id @default(cuid())\n  sequenceId  String\n  sequence    EmailSequence @relation(fields: [sequenceId], references: [id], onDelete: Cascade)\n  clientId    String\n  client      Client        @relation(fields: [clientId], references: [id], onDelete: Cascade)\n  tenantId    String\n  currentStep Int           @default(0)\n  status      String        @default(\"active\") // active, paused, completed, unsubscribed\n  enrolledAt  DateTime      @default(now())\n  nextEmailAt DateTime?\n  completedAt DateTime?\n  emailsSent  Int           @default(0)\n  createdAt   DateTime      @default(now())\n  updatedAt   DateTime      @updatedAt\n\n  emails EmailSequenceEmail[]\n\n  @@unique([sequenceId, clientId])\n  @@index([tenantId, status, nextEmailAt])\n  @@map(\"email_sequence_enrollments\")\n}\n\nmodel EmailSequenceEmail {\n  id           String                  @id @default(cuid())\n  enrollmentId String\n  enrollment   EmailSequenceEnrollment @relation(fields: [enrollmentId], references: [id], onDelete: Cascade)\n  stepOrder    Int\n  sentAt       DateTime?\n  deliveredAt  DateTime?\n  openedAt     DateTime?\n  clickedAt    DateTime?\n  status       String                  @default(\"pending\") // pending, sent, delivered, opened, clicked, bounced, failed\n  error        String?\n  resendId     String?\n  createdAt    DateTime                @default(now())\n\n  @@index([enrollmentId])\n  @@map(\"email_sequence_emails\")\n}\n\n// ============================================\n// REFERRAL PROGRAM\n// ============================================\n\nmodel Referral {\n  id                    String    @id @default(cuid())\n  tenantId              String\n  referrerId            String\n  referrer              Client    @relation(\"Referrer\", fields: [referrerId], references: [id], onDelete: Cascade)\n  referredId            String?\n  referred              Client?   @relation(\"Referred\", fields: [referredId], references: [id])\n  referralCode          String    @unique\n  referredEmail         String?\n  referredName          String?\n  referredPhone         String?\n  status                String    @default(\"pending\") // pending, signed_up, qualified, rewarded, expired\n  createdAt             DateTime  @default(now())\n  signedUpAt            DateTime?\n  qualifiedAt           DateTime?\n  rewardedAt            DateTime?\n  expiresAt             DateTime?\n  referrerReward        Json?     @db.JsonB\n  referredReward        Json?     @db.JsonB\n  referrerRewardApplied Boolean   @default(false)\n  referredRewardApplied Boolean   @default(false)\n  source                String? // link, email, social, qr\n\n  @@index([tenantId, referrerId, status])\n  @@map(\"referrals\")\n}\n\nmodel ReferralSettings {\n  id                    String   @id @default(cuid())\n  tenantId              String   @unique\n  isActive              Boolean  @default(true)\n  referrerRewardType    String   @default(\"credits\") // credits, discount, cash\n  referrerRewardValue   Int      @default(1)\n  referredRewardType    String   @default(\"discount\")\n  referredRewardValue   Int      @default(10)\n  qualificationCriteria String   @default(\"first_session\") // signup, first_session, first_payment\n  maxReferralsPerClient Int?\n  referralCodeExpiry    Int? // days\n  sendReferralEmails    Boolean  @default(true)\n  createdAt             DateTime @default(now())\n  updatedAt             DateTime @updatedAt\n\n  @@map(\"referral_settings\")\n}\n\n// ============================================\n// ANALYTICS\n// ============================================\n\nmodel AnalyticsSnapshot {\n  id        String   @id @default(cuid())\n  tenantId  String\n  date      DateTime @default(now())\n  period    String // daily, weekly, monthly\n  metrics   Json     @db.JsonB\n  createdAt DateTime @default(now())\n\n  @@unique([tenantId, date, period])\n  @@index([tenantId, date])\n  @@map(\"analytics_snapshots\")\n}\n"
}

